import React, {Component} from 'react';

class Receta extends Component {
    render() {
        const { titulo, categoria, descripcion } = this.props.receta;
        return (
            <div className="col-12">
                <div className="col-4">
                    {/* <img src={} alt={titulo} /> */}
                </div>
                <div className="col-8">
                    <h2>{titulo}</h2>
                    <p>Categoria: {categoria}</p>
                    <p>{descripcion}</p>
                </div>
            </div>
        )
    }
}

export default Receta;
